				["actions"] = {
					["start"] = {
					},
					["init"] = {
						["do_custom"] = true,
						["custom"] = "-- 代码扒自SimpleChat 作者 五区-塞拉摩-Leyvaten SimpleChat插件更新地址 http://nga.178.com/read.php?tid=9633520\n--[[ 作者备注\n配置选项\niconSize 表情大小你可以根据聊天字号调整\noffsetX 标情况相当于输入框中心的X偏移\noffsetY 标情况相当于输入框中心的Y偏移\nenableEmoteInput 允许解析聊天输入表情\nenableBubbleEmote 允许解析聊天泡泡表情\n]]\nlocal chatFrame = SELECTED_DOCK_FRAME\nlocal inputbox = chatFrame.editBox\nlocal e = aura_env\nlocal region = WeakAuras.GetRegion(e.id) \n\nlocal Config = {\n    iconSize = e.config.iconSize, --改 以便在WA自定义选项中修改 下同 原18,\n    offsetX = e.config.offsetX, --改 原30,\n    offsetY = e.config.offsetY, -- 改 原30,\n    enableEmoteInput = true\n    -- ,enableBubbleEmote = false -- 这个功能会扫描所有聊天泡泡框架解析表情，容易扫描到被保护的框架，所以暂时移除了。\n}\n\n\n-- 表情选择器框架\nlocal EmoteTableFrame\n\n-- 表情解析规则\nlocal fmtstring = format(\"\\124T%%s:%d\\124t\", max(floor(select(2, SELECTED_CHAT_FRAME:GetFont())), Config.iconSize))\n\n-- 自定义表情开始的序号\nlocal customEmoteStartIndex = 9\n\nlocal emotes = {\n    --原版暴雪提供的8个图标\n    {\"{rt1}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_1]=]},\n    {\"{rt2}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_2]=]},\n    {\"{rt3}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_3]=]},\n    {\"{rt4}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_4]=]},\n    {\"{rt5}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_5]=]},\n    {\"{rt6}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_6]=]},\n    {\"{rt7}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_7]=]},\n    {\"{rt8}\", [=[Interface\\TargetingFrame\\UI-RaidTargetingIcon_8]=]},\n    --自定义表情\n    {\"{天使}\", [=[Interface\\SimpleChatEmojis\\Angel]=]},\n    {\"{生气}\", [=[Interface\\SimpleChatEmojis\\Angry]=]},\n    {\"{大笑}\", [=[Interface\\SimpleChatEmojis\\Biglaugh]=]},\n    {\"{鼓掌}\", [=[Interface\\SimpleChatEmojis\\Clap]=]},\n    {\"{酷}\", [=[Interface\\SimpleChatEmojis\\Cool]=]},\n    {\"{哭}\", [=[Interface\\SimpleChatEmojis\\Cry]=]},\n    {\"{可爱}\", [=[Interface\\SimpleChatEmojis\\Cutie]=]},\n    {\"{鄙视}\", [=[Interface\\SimpleChatEmojis\\Despise]=]},\n    {\"{美梦}\", [=[Interface\\SimpleChatEmojis\\Dreamsmile]=]},\n    {\"{尴尬}\", [=[Interface\\SimpleChatEmojis\\Embarrass]=]},\n    {\"{邪恶}\", [=[Interface\\SimpleChatEmojis\\Evil]=]},\n    {\"{兴奋}\", [=[Interface\\SimpleChatEmojis\\Excited]=]},\n    {\"{晕}\", [=[Interface\\SimpleChatEmojis\\Faint]=]},\n    {\"{打架}\", [=[Interface\\SimpleChatEmojis\\Fight]=]},\n    {\"{流感}\", [=[Interface\\SimpleChatEmojis\\Flu]=]},\n    {\"{呆}\", [=[Interface\\SimpleChatEmojis\\Freeze]=]},\n    {\"{皱眉}\", [=[Interface\\SimpleChatEmojis\\Frown]=]},\n    {\"{致敬}\", [=[Interface\\SimpleChatEmojis\\Greet]=]},\n    {\"{鬼脸}\", [=[Interface\\SimpleChatEmojis\\Grimace]=]},\n    {\"{龇牙}\", [=[Interface\\SimpleChatEmojis\\Growl]=]},\n    {\"{开心}\", [=[Interface\\SimpleChatEmojis\\Happy]=]},\n    {\"{心}\", [=[Interface\\SimpleChatEmojis\\Heart]=]},\n    {\"{恐惧}\", [=[Interface\\SimpleChatEmojis\\Horror]=]},\n    {\"{生病}\", [=[Interface\\SimpleChatEmojis\\Ill]=]},\n    {\"{无辜}\", [=[Interface\\SimpleChatEmojis\\Innocent]=]},\n    {\"{功夫}\", [=[Interface\\SimpleChatEmojis\\Kongfu]=]},\n    {\"{花痴}\", [=[Interface\\SimpleChatEmojis\\Love]=]},\n    {\"{邮件}\", [=[Interface\\SimpleChatEmojis\\Mail]=]},\n    {\"{化妆}\", [=[Interface\\SimpleChatEmojis\\Makeup]=]},\n    -- {\"{马里奥}\", [=[Interface\\SimpleChatEmojis\\Mario]=]},\n    {\"{沉思}\", [=[Interface\\SimpleChatEmojis\\Meditate]=]},\n    {\"{可怜}\", [=[Interface\\SimpleChatEmojis\\Miserable]=]},\n    {\"{好}\", [=[Interface\\SimpleChatEmojis\\Okay]=]},\n    {\"{漂亮}\", [=[Interface\\SimpleChatEmojis\\Pretty]=]},\n    {\"{吐}\", [=[Interface\\SimpleChatEmojis\\Puke]=]},\n    {\"{握手}\", [=[Interface\\SimpleChatEmojis\\Shake]=]},\n    {\"{喊}\", [=[Interface\\SimpleChatEmojis\\Shout]=]},\n    {\"{闭嘴}\", [=[Interface\\SimpleChatEmojis\\Shuuuu]=]},\n    {\"{害羞}\", [=[Interface\\SimpleChatEmojis\\Shy]=]},\n    {\"{睡觉}\", [=[Interface\\SimpleChatEmojis\\Sleep]=]},\n    {\"{微笑}\", [=[Interface\\SimpleChatEmojis\\Smile]=]},\n    {\"{吃惊}\", [=[Interface\\SimpleChatEmojis\\Suprise]=]},\n    {\"{失败}\", [=[Interface\\SimpleChatEmojis\\Surrender]=]},\n    {\"{流汗}\", [=[Interface\\SimpleChatEmojis\\Sweat]=]},\n    {\"{流泪}\", [=[Interface\\SimpleChatEmojis\\Tear]=]},\n    {\"{悲剧}\", [=[Interface\\SimpleChatEmojis\\Tears]=]},\n    {\"{想}\", [=[Interface\\SimpleChatEmojis\\Think]=]},\n    {\"{偷笑}\", [=[Interface\\SimpleChatEmojis\\Titter]=]},\n    {\"{猥琐}\", [=[Interface\\SimpleChatEmojis\\Ugly]=]},\n    {\"{胜利}\", [=[Interface\\SimpleChatEmojis\\Victory]=]},\n    {\"{雷锋}\", [=[Interface\\SimpleChatEmojis\\Volunteer]=]},\n    {\"{委屈}\", [=[Interface\\SimpleChatEmojis\\Wronged]=]}\n}\n\nlocal function ChatEmoteFilter(self, event, msg, ...)\n    for i = customEmoteStartIndex, #emotes do\n        if msg:find(emotes[i][1]) then\n            msg = msg:gsub(emotes[i][1], format(fmtstring, emotes[i][2]), 1)\n            break\n        end\n    end\n    return false, msg, ...\nend\n\nlocal function EmoteIconMouseUp(frame, button)\n    if (button == \"LeftButton\") then\n        local ChatFrameEditBox = ChatEdit_ChooseBoxForSend()\n        if (not ChatFrameEditBox:IsShown()) then\n            ChatEdit_ActivateChat(ChatFrameEditBox)\n        end\n        ChatFrameEditBox:Insert(frame.text)\n    end\n    ToggleEmoteTable()\nend\n\nlocal function CreateEmoteTableFrame()\n    EmoteTableFrame = CreateFrame(\"Frame\", \"EmoteTableFrame\", UIParent)\n    \n    EmoteTableFrame:SetBackdrop(\n        {\n            bgFile = \"\", --\"Interface\\\\Buttons\\\\WHITE8x8\",\n            edgeFile = \"\", --\"Interface\\\\Tooltips\\\\UI-Tooltip-Border\",\n            tile = true,\n            tileSize = 16,\n            edgeSize = 16,\n            insets = {left = 3, right = 3, top = 3, bottom = 3}\n        }\n    )\n    EmoteTableFrame:SetBackdropColor(0.05, 0.05, 0.05, 0.8)\n    EmoteTableFrame:SetBackdropBorderColor(0.3, 0.3, 0.3)\n    EmoteTableFrame:SetWidth((Config.iconSize + 6) * 12 + 10)\n    EmoteTableFrame:SetHeight((Config.iconSize + 6) * 5 + 10)\n    EmoteTableFrame:SetPoint(\"CENTER\", region, \"CENTER\", Config.offsetX, Config.offsetY)\n    -- 表情选择框出现位置 默认30,30\n    EmoteTableFrame:Hide()\n    EmoteTableFrame:SetFrameStrata(\"DIALOG\")\n    \n    local icon, row, col\n    row = 1\n    col = 1\n    for i = 1, #emotes do\n        text = emotes[i][1]\n        texture = emotes[i][2]\n        icon = CreateFrame(\"Frame\", format(\"IconButton%d\", i), EmoteTableFrame)\n        icon:SetWidth(Config.iconSize + 6)\n        icon:SetHeight(Config.iconSize + 6)\n        icon.text = text\n        icon.texture = icon:CreateTexture(nil, \"ARTWORK\")\n        icon.texture:SetTexture(texture)\n        icon.texture:SetAllPoints(icon)\n        icon:Show()\n        icon:SetPoint(\"TOPLEFT\", 5 + (col - 1) * (Config.iconSize + 6), -5 - (row - 1) * (Config.iconSize + 6))\n        icon:SetScript(\"OnMouseUp\", EmoteIconMouseUp)\n        icon:SetScript(\"OnEnter\", function(self)\n                GameTooltip_SetDefaultAnchor(GameTooltip, UIParent)\n                GameTooltip:AddLine(emotes[i][1])\n                GameTooltip:Show()\n        end)\n        icon:SetScript(\"OnLeave\", function(self)\n                GameTooltip:Hide()\n        end)\n        icon:EnableMouse(true)\n        col = col + 1\n        if (col > 12) then\n            row = row + 1\n            col = 1\n        end\n    end\nend\n\nfunction ToggleEmoteTable()\n    if (not EmoteTableFrame) then\n        CreateEmoteTableFrame()\n    end\n    if (EmoteTableFrame:IsShown()) then\n        EmoteTableFrame:Hide()\n    else\n        EmoteTableFrame:Show()\n    end\nend\n\n\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_CHANNEL\", ChatEmoteFilter) -- 公共频道\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_SAY\", ChatEmoteFilter) -- 说\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_YELL\", ChatEmoteFilter) -- 大喊\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_RAID\", ChatEmoteFilter) -- 团队\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_RAID_LEADER\", ChatEmoteFilter) -- 团队领袖\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_PARTY\", ChatEmoteFilter) -- 队伍\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_PARTY_LEADER\", ChatEmoteFilter) -- 队伍领袖\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_GUILD\", ChatEmoteFilter) -- 公会\n\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_AFK\", ChatEmoteFilter) -- AFK玩家自动回复\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_DND\", ChatEmoteFilter) -- 切勿打扰自动回复\n\n-- 副本和副本领袖\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_INSTANCE_CHAT\", ChatEmoteFilter)\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_INSTANCE_CHAT_LEADER\", ChatEmoteFilter)\n-- 解析战网私聊\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_WHISPER\", ChatEmoteFilter)\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_WHISPER_INFORM\", ChatEmoteFilter)\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_BN_WHISPER\", ChatEmoteFilter)\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_BN_WHISPER_INFORM\", ChatEmoteFilter)\n-- 解析社区聊天内容\nChatFrame_AddMessageEventFilter(\"CHAT_MSG_COMMUNITIES_CHANNEL\", ChatEmoteFilter)\n\nif not _G[e.id..\"Button\"] then \n    e.btn = CreateFrame(\"Button\", e.id..\"Button\", region) \n    e.btn:RegisterForClicks(\"AnyUp\")\n    e.btn:SetAllPoints(region)\nend\n\nlocal btn = _G[e.id..\"Button\"]\n\nbtn:SetScript(\"OnClick\", function(self)\n        ToggleEmoteTable()\nend)\nbtn:SetScript(\"OnMouseUp\", function(self)\n        region:SetAlpha(1)\nend)\nbtn:SetScript(\"OnMouseDown\", function(self)\n        region:SetAlpha(0.5)\nend)\nbtn:SetScript(\"OnEnter\",function(self)\n        region:SetScale(1.25)\nend)\nbtn:SetScript(\"OnLeave\",function(self)\n        region:SetScale(1)\nend)",
