					["init"] = {
						["do_custom"] = true,
						["custom"] = "local chatFrame = SELECTED_DOCK_FRAME\nlocal inputbox = chatFrame.editBox\nlocal e = aura_env\nlocal region = WeakAuras.GetRegion(e.id) \n\nif not _G[e.id..\"Button\"] then \n    e.btn = CreateFrame(\"Button\", e.id..\"Button\", region) \n    e.btn:RegisterForClicks(\"AnyUp\")\n    e.btn:SetAllPoints(region)\nend\n\nlocal btn = _G[e.id..\"Button\"]\n\nbtn:SetScript(\"OnClick\", function(self, button)\n        if button == \"RightButton\" then\n            local _, channelName, _ = GetChannelName(\"大脚世界频道\")\n            if channelName == nil then\n                JoinPermanentChannel(\"大脚世界频道\", nil, 1, 1)\n                ChatFrame_RemoveMessageGroup(chatFrame, \"CHANNEL\")\n                ChatFrame_AddChannel(chatFrame, \"大脚世界频道\")\n                print(\"|cff00d200已加入大脚世界频道|r\")\n            else\n                LeaveChannelByName(\"大脚世界频道\")\n                print(\"|cffd20000已离开大脚世界频道|r\")\n            end\n        else\n            if ChatEdit_GetActiveWindow() and IsShiftKeyDown() then\n                ChatEdit_DeactivateChat(inputbox)\n            else\n                local channel,channelName, _ = GetChannelName(\"大脚世界频道\")\n                if channelName == nil then\n                    print(\"|cffffd700你不在大脚世界频道 右键点击以加入|r\")\n                else\n                    ChatFrame_OpenChat(\"/\" .. channel .. \" \" .. inputbox:GetText(), chatFrame)  \n                end\n            end\n        end\nend)\nbtn:SetScript(\"OnMouseUp\", function(self)\n        region:SetAlpha(1)\nend)\nbtn:SetScript(\"OnMouseDown\", function(self)\n        region:SetAlpha(0.5)\nend)\nbtn:SetScript(\"OnEnter\",function(self)\n        region:SetScale(1.25)\nend)\nbtn:SetScript(\"OnLeave\",function(self)\n        region:SetScale(1)\nend)",
					},
				},
			},
		},
